(79, 'widget_text', 'a:6:{i:1;a:4:{s:5:\"title\";s:16:\"Coorporate Theme\";s:4:\"text\";s:257:\"Project Research and Analysis  give us the idea of understanding our Strategies alias explicabo fuga enim, praesentium Velit rependerit natus vero, minus possimus mollitia nostrum. Architecto unde animi velit facilis, ex totam doloremque at nemo voluptates\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:2;a:4:{s:5:\"title\";s:17:\"À PROPOS DE NOUS\";s:4:\"text\";s:169:\"Nous sommes une agence à Casablanca de Transformation Digitale, qui fait croître les marques, les réputations et développe des solutions numériques de qualité.\r\n\r\n\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}s:12:\"_multiwidget\";i:1;i:4;a:4:{s:5:\"title\";s:12:\"NOS SERVICES\";s:4:\"text\";s:294:\"<a href=\"http://localhost/ethel-technologies/nos-services/marketing-digitale/\">Marketing Digitale </a>\r\n<a href=\"http://localhost/ethel-technologies/nos-services/developpement-web/\">Développement Web</a>\r\n<a href=\"http://localhost/ethel-technologies/nos-services/e-marketing/\">E-Marketing</a>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:5;a:4:{s:5:\"title\";s:10:\"EXPERTISES\";s:4:\"text\";s:303:\"– Référencement naturel (SEO)\r\n– Marketing sur les réseaux sociaux\r\n– Campagnes d’emailing.\r\n– Pubs Facebook\r\n– Bannière publicitaires et annonces analytiques\r\n– Développement web personnalisé\r\n– Web design\r\n– Sites web WordPress et Maintenance\r\n– Plus De Trafic &amp; De Vente\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:6;a:4:{s:5:\"title\";s:7:\"CONTACT\";s:4:\"text\";s:204:\"<b>Adresse :</b> IMM N°217, 5EME ETAGE, N°14, BD BRAHIM ROUDANI, CASABLANCA, MAROC\r\n<b>E-mail :</b> ETHELS.CONTACT@GMAIL.COM\r\n<b>Tél :</b> +212 656585608 +212 694153246\r\n<b>Fix :</b> +212 522994845\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}}', 'yes'),
