(448, 1, '2020-02-24 11:34:48', '2020-02-24 10:34:48', '<figure><img src=\"http://localhost/ethel-technologies/wp-content/uploads/2020/02/email-1.png\" title=\"\" alt=\"\" /></figure><p>ETHELS.CONTACT@GMAIL.COM</p>		\n			<figure><img width=\"150\" height=\"150\" src=\"http://localhost/etheltechnologies/wp-content/uploads/2020/02/telephone-150x150.png\" alt=\"\" srcset=\"http://localhost/etheltechnologies/wp-content/uploads/2020/02/telephone-150x150.png 150w, http://localhost/etheltechnologies/wp-content/uploads/2020/02/telephone.png 256w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></figure><p>+212 522994845 &nbsp&nbsp&nbsp       +212 656585608  &nbsp&nbsp&nbsp    +212 694153246\n</p>		\n			<figure><img src=\"http://localhost/ethel-technologies/wp-content/uploads/2020/02/pin.png\" title=\"\" alt=\"\" /></figure><p>IMM N°217, 5EME ETAGE, N°14, BD BRAHIM ROUDANI, CASABLANCA, MAROC\n</p>		\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=BD%20BRAHIM%20ROUDANI%2C%20CASABLANCA%2C%20MAROC&amp;t=m&amp;z=13&amp;output=embed&amp;iwloc=near\" aria-label=\"BD BRAHIM ROUDANI, CASABLANCA, MAROC\"></iframe>		\n		[contact-form-7 id=\"388\" title=\"Formulaire de contact 1\"]', 'Contact', '', 'publish', 'closed', 'closed', '', 'contact', '', '', '2020-02-24 14:22:02', '2020-02-24 13:22:02', '', 0, 'http://localhost/etheltechnologies/?page_id=448', 0, 'page', '', 0),
