(582, 1, '2020-02-25 17:39:50', '2020-02-25 16:39:50', '<h2>Qu’est-ce que le marketing digital ?</h2>\nLe marketing digital désigne toutes les techniques marketing utilisées sur des supports et canaux digitaux pour promouvoir des produits et services. Dans le marketing digital ressort une notion essentielle, l’interactivité. On peut également parler de webmarketing puisque la différence est liée principalement à l’environnement, ici internet. Le marketing digital contrairement au marketing traditionnel met le client au cœur de sa stratégie. Le marketing digital procède de deux évolutions : les applications marketing liées à Internet et celles liées aux nouvelles technologies de l’information et de la communication. Dans cet article définissant le marketing digital, nous le présenterons sous ses différentes formes. On peut citer entre autres, l’emailing ou l’email marketing, le référencement naturel ou SEO, les liens commerciaux etc.\n<h2>L’emailing ou email marketing</h2>\nL’emailing est une forme de marketing digital qui regroupe toutes les utilisations de l’email dans le domaine de la publicité en ligne. L’usage de l’emailing est aujourd’hui lié aux problématiques de fidélisation clients, activation de clients etc. Cette pratique comprend des usages relationnels, transactionnels (les newsletters), ou des usages de prospection ou pratiques de sponsoring. On enregistre 131 milliards d’emails envoyés en 2016 pour un chiffre d’affaires de 105 millions d’euros sur les 22 routeurs membres du SNCD. L’emailing ou email marketing, garde toujours une place importante dans le domaine du marketing digital.\n<h2>Le référencement naturel ou SEO</h2>\nLe référencement naturel ou SEO est l’une des branches du Search engine marketing. Cette notion de marketing digital désigne l’ensemble des techniques utilisées pour optimiser un site internet ou des pages. En d’autres termes, cet usage vise à se positionner au premier rang des résultats naturels sur des moteurs de recherche, et notamment Google, suite aux requêtes ciblées des internautes.', 'Qu’est-ce que le marketing digital ?', 'Le marketing digital désigne toutes les techniques marketing utilisées sur des supports et canaux digitaux pour promouvoir des produits et services.', 'inherit', 'closed', 'closed', '', '206-revision-v1', '', '', '2020-02-25 17:39:50', '2020-02-25 16:39:50', '', 206, 'http://localhost/etheltechnologies/2020/02/25/206-revision-v1/', 0, 'revision', '', 0),
