}\\n.blog-wrap-title a:hover{\\n\\tcolor:#F6BE33;\\n}\\n.widget-title {\\n    color: #ebebeb;\\n    font-size: 14px;\\n    text-transform: uppercase;\\n}\\n.team-members-contents  h2{\\n\\tcolor:#757575;\\n}\\n.blog-wrap-title, .entry-title, .entry-title a {\\n    color: #ebebeb;\\n}\\n.comment-respond .comment-reply-title {\\n    color: #ebebeb;\\n}\\n.logged-in-as{\\n\\tdisplay:none;\\n}\\n.comments-area .comments-title { color: #ebebeb;\\n}\\n.comments-area .comment-list .comment-metadata a {\\n   color: #ebebeb;\\n}\\n.comments-area .comment-list .reply a {\\n    color: #ebebeb;\\n}\\n.comment-respond h3 small a {\\n    color: #ebebeb;\\n}\\n.agency-lite-faq-wrapper {\\n    background: white;\\n}\\n.serv-btn a, .feat-btn a {\\n    display:none;\\n}\\n.features-image-wrap img {\\n    width:90px;\\n}\\n\\n\",\n        \"type\": \"custom_css\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-02-28 10:19:08\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', '92c1c397-1e8f-4ad2-9cc8-185b6b710694', '', '', '2020-02-28 11:19:08', '2020-02-28 10:19:08', '', 0, 'http://localhost/etheltechnologies/?p=680', 0, 'customize_changeset', '', 0),
(681, 1, '2020-02-28 11:19:08', '2020-02-28 10:19:08', '\n.site-header {\n    position: relative;\n    background:#21294a;\n	height:105px;\n    border-bottom: 1px solid #F6F6F6;\n	\n}\n.site-header .main-navigation .primary-menu li a {\n    font-size: 16px;\n    color: #F7A945;\n    padding: 20px 15px;\n}\n.site-header .main-navigation .primary-menu li ul li a {\n    padding: 10px;\n    border-top: 1px solid #f1f1f1;\n}\n.site-footer {\n    \n    padding-top: 50px;\n}\n\n.agency-lite-footer-wrap {\n    background: #191E36;\n    padding: 10px 0;\n}\n\n.agency-lite-footer-image-control img {\n    display: block;\n	width:166px;\n	height:69px;\n}\n.site-header {\n    position: relative;\n    border-bottom: 5px solid #21294A;\n}\n#primary, #secondary {\n    float: left;\n    text-align: left;\n    \n    padding-bottom: 1px;\n}\n.formclass{\n	width:100%;\n}\n\n\n.agency-lite-section-logo {\n    border-top: 0px solid #f1f1f1;\n    border-bottom: 1px solid #f1f1f1;\n}\n.section-title h2 {\n    color: #ebebeb;\n\n}\nbody, button, input, select, optgroup, textarea {\n    color: #ebebeb;\n}\n.section-description {\n    color: #ebebeb;\n}\n.agency-lite-feature-title {\n    color: #ebebeb;\n}\n.serv-btn a, .feat-btn a {\n    color: grey;\n    background-color:white;\n}\n.member-name h5 {\n    color: #ebebeb;\n}\n.blog-title a {\n    color: #ebebeb;\n}\n.textwidget{\n	color:#757575;\n}\n.wrap-date-comment .blog-date, .blog-author a {\n    color: #ebebeb;\n}\n\n.agency_lite_featured-content-main p {\n	color:#757575;\n}\n.agency-lite-footer-copyright {\n    color: #ebebeb;\n}\n.agency-lite-footer-copyright a {\n    color: #ebebeb;\n}\n.agency-lite-footer-copyright a {\n    color: #ebebeb;\n}\n.comment-author-date span, .comment-author-date span a {\n    color: #ebebeb;\n}\n.blog-wrap-title a{\n	color:#ebebeb;\n}\n.blog-wrap-title a:hover{\n	color:#F6BE33;\n}\n.widget-title {\n    color: #ebebeb;\n    font-size: 14px;\n    text-transform: uppercase;\n}\n.team-members-contents  h2{\n	color:#757575;\n}\n.blog-wrap-title, .entry-title, .entry-title a {\n    color: #ebebeb;\n}\n.comment-respond .comment-reply-title {\n    color: #ebebeb;\n}\n.logged-in-as{\n	display:none;\n}\n.comments-area .comments-title { color: #ebebeb;\n}\n.comments-area .comment-list .comment-metadata a {\n   color: #ebebeb;\n}\n.comments-area .comment-list .reply a {\n    color: #ebebeb;\n}\n.comment-respond h3 small a {\n    color: #ebebeb;\n}\n.agency-lite-faq-wrapper {\n    background: white;\n}\n.serv-btn a, .feat-btn a {\n    display:none;\n}\n.features-image-wrap img {\n    width:90px;\n}\n\n', 'agency-lite', '', 'inherit', 'closed', 'closed', '', '427-revision-v1', '', '', '2020-02-28 11:19:08', '2020-02-28 10:19:08', '', 427, 'http://localhost/etheltechnologies/2020/02/28/427-revision-v1/', 0, 'revision', '', 0);
